import React, { Component } from 'react';
import './App.css';
import Posts from './PostsContainer/PostsContainer';
import EventfulContainer from './EventfulContainer/EventfulContainer';
import { Col, Container, Row} from 'reactstrap';


class App extends Component {
  render() {
    return (
      <div className="App">
        <Container>
          <Col xs="6">
             <EventfulContainer />
          </Col>
          <Col xs="6">
            <Posts /> 
          </Col>


        </Container>



      </div>
    );
  }
}

export default App;
